import React from 'react';
import s from './Search.module.css';

export default function Dropdown({ results }) {
  return (
    <div className={s.dropdown}>
      {results.map(result => (
        <div key={result.id} className={s.dropdownItem}>
          {result.name}
        </div>
      ))}
    </div>
  );
}
